  ctx.value.lineCap = selectedBrush.value;
  ctx.value.strokeStyle = currentColor.value;

  ctx.value.beginPath();
  ctx.value.moveTo(lastX.value, lastY.value);
  ctx.value.lineTo(x, y);
  ctx.value.stroke();
